import React, { useState, useEffect } from "react";
import { Form, Button, Row, Col, Card } from "react-bootstrap";

const Signup = () => {
  const [region, setRegion] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [name, setName] = useState("");

  useEffect(() => {}, []);

  return (
    <div className="container">
      <Card
        className="col-7"
        style={{ marginTop: "15rem", marginLeft: "280px" }}
      >
        <Card.Body>
          <Form>
            <Row className="col-6">
              <Form.Group controlId="formGridEmail">
                <Form.Label style={{ color: "#08E864" }}>Name</Form.Label>
                <Form.Control
                  type="text"
                  placeholder="Enter name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                />
              </Form.Group>
              <br />
              <Form.Group controlId="formGridEmail">
                <Form.Label style={{ color: "#08E864" }}>Email</Form.Label>
                <Form.Control
                  type="email"
                  placeholder="Enter email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
              </Form.Group>
              <br />
              <Form.Group controlId="formGridPassword">
                <Form.Label style={{ color: "#08E864" }}>Password</Form.Label>
                <Form.Control
                  type="password"
                  placeholder="Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />
              </Form.Group>
              <br /><br />
              <Form.Group controlId="formGridAddress1">
                <Form.Label style={{ color: "#08E864" }}>Region</Form.Label>
                <Form.Control
                  placeholder="Region"
                  value={region}
                  onChange={(e) => setRegion(e.target.value)}
                />
              </Form.Group>
            </Row>

            <br />
            <Button
              type="submit"
              style={{
                backgroundColor: "#08E864",
                fontWeight: "bold",
                border: "#08E864",
              }}
            >
              Submit
            </Button>
          </Form>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Signup;
